import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import * as serviceWorker from './serviceWorker';
import {Provider} from "react-redux";
import {configureStore, createReducer, getDefaultMiddleware}  from "@reduxjs/toolkit";

import productsReducer, {productsFetch } from './markup/Pages/features/productsSlice';
import {  productsApi } from './markup/Pages/features/productsApi';

//import cartReducer from './markup/Pages/features/cartSlice';

const store = configureStore({
    reducer: {
        products: productsReducer,
        cart: createReducer,
        [productsApi.reducerPath]: productsApi.reducer,
         },
            middleware: (getDefaultMiddleware) =>
            getDefaultMiddleware().concat(productsApi.middleware),

});

store.dispatch(productsFetch());
ReactDOM.render(
    <React.StrictMode>
<Provider store= {store}>
<App />
</Provider>
</React.StrictMode>,
 document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
